using SpotFinder.Models.Core;
using SpotFinder.ViewModels.Xaml;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

using Xamarin.Forms;
using Xamarin.Forms.Maps;
using Xamarin.Forms.Xaml;

namespace SpotFinder.Views.Xaml
{
    [XamlCompilation(XamlCompilationOptions.Compile)]
    public partial class PlaceDetailsPage : ContentPage
    {
        public PlaceDetailsPage()
        {
            var place = CreateMockPlace();

            InitializeComponent();
            BindingContext = new PlaceDetailsViewModel(place);

            MyMap.MoveToRegion(MapSpan.FromCenterAndRadius(new Position(place.Location.Latitude, place.Location.Longitude), Distance.FromMiles(0.3)));

            var pin = new Pin
            {
                Type = PinType.Place,
                Position = new Position(place.Location.Latitude, place.Location.Longitude),
                Label = place.Name + " ",
                Address = place.Description + " "
            };

            MyMap.Pins.Add(pin);
            
        }

        private Place CreateMockPlace()
        {
            var location = new Location();
            location.Longitude = 19.462049938738346;
            location.Latitude = 51.75320834145868;
            var place = new Place
            {
                Name = "Spot name",
                Description = "To jest jakiś tam zamockowany opis spotu.",
                Bank = true,
                Rail = true,
                Ledge = true,
                Location = location,
            };

            place.PhotosBase64 = new List<string>();
            place.PhotosBase64.Add("");
            place.PhotosBase64.Add("");

            return place;
        }
    }
}